import React from 'react'

function App() {
  const reyes = [
    {
      nombre: 'Atanagildo',
      reinado : 15,
      vacasComidas : 9
    },
    {
      nombre: 'Ervigio',
      reinado: 7,
      vacasComidas: 3,
    },
    {
      nombre: 'Ataúlfo',
      reinado: 5,
      vacasComidas: 16,
    },
    {
      nombre: 'Leovigildo',
      reinado: 18,
      vacasComidas: 3
    },
    {
      nombre: 'Sisebuto',
      reinado: 19,
      vacasComidas: 11
    },
    {
      nombre: 'Teodorico',
      reinado: 33,
      vacasComidas: 12
    }
  ]


  const resultado1=reyes.filter(valor=>valor.vacasComidas>=10).
  map(valor=>
    <div>{valor.nombre} come {valor.vacasComidas}</div>);


  return (
    <>
      <div className='caja'>
        {resultado1}
      </div>
    </>
  )
}

export default App
